import React from "react";
import { Link } from "react-router-dom";

import ImageControls from "../ImageControls/image-controls.components";
import LazyImage from "../LazyImage/lazy-image.component";

const ImageItem = (element) => (
  <div className="relative" style={{ backgroundColor: element.color }}>
    <Link to={`/image/${element.id}`}>
      <LazyImage {...element} />
    </Link>
    {/* <ImageControls
      element={element}
    /> */}
  </div>
);

export default ImageItem;
